import React from 'react';
import logojd from '../jd.png';
function Header(){
  let section = {
    width : "20%",
    height : "10%",
    backgroundImage : "url(" + { logojd } + ")"
  };
  return (
    <div>
      <img style = {section} />;
    </div>
  )
}

export default Header
